import {
  AiFillCaretDown,
  AiOutlineClose,
  AiOutlineMinus,
} from "react-icons/ai";
import { Link, useHistory, useLocation } from "react-router-dom";
import React, { useEffect, useState } from "react";
import { BsPlus } from "react-icons/bs";
import { GiCheckMark } from "react-icons/gi";
import { Modal } from "react-bootstrap";
import axios from "axios";
import Header from "../Header";


export default function RegistrationFormCertification() {
  
  const history = useHistory();
  const intialValues = {
    first_name: "",
    last_name: "",
    address: "",
    city: "",
    state: "",
    zip_Code: "",
    mobile: "",
    age: "",
    gender: "",
    email: "",
    password: "",
    confirmPassword: "",
    church: "",
    maritalStatus: "",
    firstChildren: "",
    secondChildren: "",
    thirdChildren: "",
    forthChildren: "",
    fifthChildren: "",
    sixChildren: "",
    seventhChildren: "",
    eightChildren: "",
    ninthChildren: "",
    tenthChildren: "",
    most_Passionate_Activity: "",
    second_Most_Passionate_Activity: "",
    third_Most_Passionate_Activity: "",
    most_Challenging_Past_Exp: "",
    second_Most_Challenging_Past_Exp: "",
    third_Most_Challenging_Past_Exp: "",
    been_saved: "",
    been_discipled: "",
    mentoring_Experience: "",
    membership_Experience: "",
    ministry_Experience: "",
    ordained: "",
    education_Level: "",
    languages_Spoken: "",
    veteran: "",
  };

  const [registrationForm, setRegistrationForm] = useState(intialValues);
  const [show, setShow] = useState(false);
  const [errors, setErrors] = useState(false);
  const [children, setChildren] = useState([]);
