              </div>
            </div>
            <Link to="login">  <button type="button" class="btn btn-secondary canc">Cancel</button></Link>

            <button type="submit" class="btn btn-secondary subm"> <p style={{ "color": "#fbbb00" }}>Submit</p></button>
          </div>
        </div>
      </form>
    </div>
  );
}
